import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import React, { useState, useEffect } from "react";
function App() {
  const table_header = ["Date","Trade Code","High","Low","Open","Close","Volume"];
  const [data, setData] = useState([]);
  useEffect(()=>{
    axios
    .get("http://127.0.0.1:8000/stock/")
    .then((res)=>{
      setData(res.data);
    })
    .catch((err) => {
      console.error(err);
    })
  },[]);
  return (
    <div className="App">
      <table className='table'>
        <thead>
          <tr>
            {table_header.map((item, index)=>(
                <td key={index}>{item}</td>
            ))}
          </tr>
        </thead>
      </table>
        <div>
      {data.map((detail, id) => (
        <div key={id}>
          <div>
            <h1>{detail.date}</h1>
            <footer>
              --- by <cite title="Source Title">{detail.trade_code}</cite>
            </footer>
          </div>
        </div>
      ))}
    </div>
    </div>
  );
}

export default App;
